Sylvester is a big, love bug of a cat.&nbsp; He came to us at eight weeks old and now he is over 6 years old.&nbsp;&nbsp;&nbsp;He was found as a stray.&nbsp; He would prefer to be the center of your attention.&nbsp; He will tolerate other pets, but her would prefer to be the only one.&nbsp; He will need time to adjust to a new hone and new people.&nbsp;We are currently only doing online adoptions email us for an application!

