Hello there! I&#39;m Pistol, and I live alongside my brother, Echo.&nbsp;Both of us came from a litter of kittens that was born in a garage.&nbsp;We&#39;ve been at the shelter for a few years now, and we&#39;re hoping you can help us find our forever family!

We&#39;d like&nbsp;a quieter home&nbsp;that will allow us to acclimate and get used to our surroundings, and we do&nbsp;love to run, jump, and explore together. You can find us frequently playing with toys and playing on big cat towers.&nbsp;We make a great pair, and we&#39;d make an even better addition to your family. We&#39;re also great with other cats and dogs (more pals to play with!). Please give us a chance to show you our love, and come meet us today!

&nbsp;

Spencer is a nearly 10 year old male JRT, he does have some ongoing medical concerns including arthritis in his spine, a newly repaired hip joint and some limited vision and hearing.&nbsp; Spencer is a wonderful semi-senior dog with lots of love to give to a compassionate human, and he won&#39;t mind sharing his forever home with other dogs or cats.&nbsp; Spencer is not a fit with younger children;&nbsp;he does have some lingering pain that could cause him to be snappy and he startles easily with his&nbsp;limited hearing.&nbsp; Spencer is also somewhat incontinent, however he very successfully wears a belly band and enjoys getting outside often. He can handle moderate or limited exercise, he lived for many years with a serious injury to his backend so he does have some lingering lameness.&nbsp; Spencer is happiest snuggled up in a dog bed all day, and&nbsp;he loves to stick to a schedule so&nbsp;will bark to let you know if dinner is running late! He will be most happy with someone who is mostly home during the day, although he is kennel trained, he prefers your company after all! Spencer will gladly sleep on your bed all night long, but he will need you to lift him up and down as he should no longer be jumping given the surgery he has had to repair what was a very badly damaged hip joint (surgery&nbsp;known as an FHO).&nbsp; Spencer does take some medicine long term to ease any arthritis pain or inflammation, and this will need to continued.

&nbsp;

Spencer&#39;s adoption fee is $200 and includes his neuter, microchip and current vaccinations and preventatives.&nbsp; &nbsp;Spencer has just recently had a dental procedure as well.&nbsp; Last Hope requires that all animals be kept as indoor pets only, be altered and current on vaccinations and preventatives.&nbsp; Our adoption process includes reference and background checks, a vet check and home visit. Please apply at Adopthope.org for consideration.

Hey, Lily Squirt here!!&nbsp;&nbsp;&nbsp;I&#39;m back with my foster&nbsp;family.&nbsp; I&#39;m a little sad&nbsp; because I love my adoptive family and miss them.&nbsp;&nbsp;You see they had to move and couldn&#39;t find a place to rent that would take me.&nbsp;&nbsp; I think people are afraid I would lick them too much.&nbsp;&nbsp;You see&nbsp;I&#39;m a love bug and like to give lots of kisses!!&nbsp; Apparently, not everybody likes kisses.&nbsp;&nbsp;I stayed with my foster family when I was a pup&nbsp;now I back.&nbsp;&nbsp; I really love them and it&#39;s&nbsp;been great to visit with my old doggie friends but I really want another&nbsp;family of my own.&nbsp;&nbsp;I have&nbsp;slowed down a bit since my pup days but still love to run so&nbsp;I would do best with in fenced-in yard.&nbsp; I am already housebroken, leash and crate trained!!&nbsp; &nbsp;I love to be with my people and&nbsp;snuggle!!&nbsp; My foster mom&nbsp;thinks that is the cutest thing.&nbsp;I&#39;m glad she likes kisses.&nbsp; :)&nbsp;&nbsp;I like treats too!!&nbsp; &nbsp; I do what I&#39;m told so I can get lots of treats!! &nbsp;If you are looking for a sweet, loving and active girl I&#39;m the dog for you!!&nbsp; &nbsp;But my new forever home should be just me as an &nbsp;only dog.&nbsp; Can&#39;t wait to meet you!&nbsp;





