Max was born about August 30, 2010 and weighs too much at about 60 lbs.&nbsp; He is definitely Beagley, but seems to be a bit larger and longer than normal so there could be some Basset mixed in.&nbsp; Whatever breed he may be he is about the sweetest guy you'd ever want to meet.&nbsp; He is also quiet, which we really appreciate.&nbsp; He is wonderful with the other dogs, loves to go for rides, is house trained and fine with children.&nbsp; He is with us because his human father had to take a job where he would be away for 10-12 hours a day and this was back in 2014.
&nbsp;
Max was adopted a few times and always returned.&nbsp; The first time is was because he couldn't be alone and it was much less alone than he was used to.&nbsp; Then the next two times we found humans home much or all the time and then their lives changed.&nbsp; When Max came back the third time and realizing what was happening and it was obvious his heart was hurting our amazing team of volunteers asked us to not put him back up for adoption and let him be a sanctuary pet at Joyful Rescues.&nbsp; Which he has been and he is very, very, happy here with all the dogs and there is at least one human here at ALL times.&nbsp; A volunteer once thought she'd try to foster him and found that she could not even take a shower without him becoming destructive trying to get to her. So, Max came back the same day.&nbsp; We LOVE this guy and he LOVES the volunteers and staff at the main location - Max is living his best life - the best life for him.
