Hi I am Clover! I had my DNA tested and I am a mix of a lot of cool dogs! I am&nbsp;Catahoula Leopard Dog,&nbsp;American Staffordshire Terrier,&nbsp;Lab and&nbsp;Siberian Husky.&nbsp; I&#39;m an energetic gal for my age and love exploring and smelling new places. I do have arthritis and an old ACL tear that was repaired but I&nbsp;don&#39;t let that stop me from&nbsp;being out and about, but some days it slows me down.&nbsp;Squeaky toys are my all time favorite toy! I love to carry toys around in my mouth, it&#39;s&nbsp;my thing!&nbsp;I love&nbsp;the water and playing in the kiddie pool, too! If you like water and beaches I might be the gal&nbsp;for you!&nbsp;I do need a home with no other animals, no children and an experienced dog owner. I like to be the Queen Bee after all!&nbsp; &nbsp;If you are interested in Clover, we ask you to become a volunteer&nbsp;at the Last Hope Adoption Center to get to know Clover and understand her needs. Please plan to volunteer at least once per week!&nbsp; Clover does have stranger danger fears, but warms up nicely given time and space.




