I am potty-trained and I do very well on walks - so I don&rsquo;t need a fenced yard to play in so long as I get my exercise. I am very smart and I am always doing my best to make you happy, whether I am licking your toes or being a very good girl with my many known obedience commands. I am also crate-trained, but it&rsquo;s not where I prefer to spend my time (and why would it be when I could be playing with you!) Foster mom says that they did not have to train me out of any bad behaviors when they got me. She says I am a loyal, house-trained, happy dog. I just want everyone to see my goofy smile and fall in love with me! I hope you&rsquo;ve fallen in love with me, too, so we can start playing together very soon. Love, Moka



